import React from 'react';
import { HashRouter as Router, Route, Switch } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';

// Components
import Navbar from './components/Navbar';
import Hero from './components/Hero';
import Services from './components/Services';
import Contact from './components/Contact';
import WhatsAppButton from './components/WhatsAppButton';

// Pages
import IndividualTherapy from './pages/IndividualTherapy';
import YouthTherapy from './pages/YouthTherapy';
import ChildTherapy from './pages/ChildTherapy';

// Theme configuration
const theme = createTheme({
  palette: {
    primary: {
      main: '#566542',
    },
    secondary: {
      main: '#c6a393',
    },
  },
  typography: {
    fontFamily: '"Roboto", "Helvetica", "Arial", sans-serif',
    h1: {
      fontWeight: 700,
    },
    h2: {
      fontWeight: 600,
    },
    h3: {
      fontWeight: 600,
    },
  },
});

// Home page component
const HomePage = () => (
  <>
    <Hero />
    <Services />
    <Contact />
    <WhatsAppButton />
  </>
);

const App: React.FC = () => {
  return (
    <Router>
      <ThemeProvider theme={theme}>
        <CssBaseline />
        <Navbar />
        <Switch>
          <Route exact path="/" component={HomePage} />
          <Route path="/terapia-individual" component={IndividualTherapy} />
          <Route path="/terapia-jovens" component={YouthTherapy} />
          <Route path="/psicologia-infantil" component={ChildTherapy} />
        </Switch>
      </ThemeProvider>
    </Router>
  );
};

export default App;
